import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TreeView from '@material-ui/lab/TreeView';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import ChevronRightIcon from '@material-ui/icons/ChevronRight';
import TreeItem from '@material-ui/lab/TreeItem';

const useStyles = makeStyles({
  root: {
    height: 216,
    flexGrow: 1,
    maxWidth: 400,
  },
});
const treeData = [
  {
    nodeId : 1,
    label: "Application"
  },
  {
    nodeId : 2,
    label: "Documents",
    children: [
      {
        nodeId: 3,
        label: "a",
        children: [
          {
            nodeId: 4,
            label: "b",
          },
        ]
      },
    ]
  },
  {
    nodeId: 5,
    label: "a",
    children: [
      {
        nodeId: 6,
        label: "b",
        children: [
          {
            nodeId: 7,
            label: "a",
            children: [
              {
                nodeId: 8,
                label: "b",
              },
            ]
          },{
            nodeId: 9,
            label: "a",
            children: [
              {
                nodeId: 10,
                label: "b",
              },
            ]
          },
        ]
      },
    ]
  },
  {
    nodeId: 11,
    label: "a",
    children: [
      {
        nodeId: 12,
        label: "b",
      },
    ]
  },
]
export default function MultiSelectTreeView() {
  const classes = useStyles();

  function PrintClickedLabel(event)
  {
    console.log(event.target.textContent)
    console.log(event)

    //{onLabelClick = {()=>PrintClickedLabel(this.props.label)}}
  }
  function AddData({data}){
    treeData.map(item=>(
      <TreeItem nodeId={item.nodeId} label={item.label}>
        <AddData data={item.children}/>
      </TreeItem>
    ))
  }
  return (
    <TreeView
      className={classes.root}
      defaultCollapseIcon={<ExpandMoreIcon />}
      defaultExpandIcon={<ChevronRightIcon />}
      multiSelect
      onNodeSelect={PrintClickedLabel}
    >
      {
        
      }
      <TreeItem nodeId="1" label="Applications" onLabelClick={PrintClickedLabel}>
        <TreeItem nodeId="2" label="Calendar" />
        <TreeItem nodeId="3" label="Chrome" />
        <TreeItem nodeId="4" label="Webstorm" />
      </TreeItem>
      <TreeItem nodeId="5" label="Documents">
        <TreeItem nodeId="6" label="Material-UI">
          <TreeItem nodeId="7" label="src">
            <TreeItem nodeId="8" label="index.js" />
            <TreeItem nodeId="9" label="tree-view.js" />
          </TreeItem>
        </TreeItem>
      </TreeItem>
    </TreeView>
  );
}
